import NavBar from "./routes-nav/NavBar";
import Routes from "./routes-nav/Routes";
import PantryApi from "./pantryApi";
import "./App.css";
import User from "../../pantry-backend/models/user";

function App() {
  return (
    <BrowserRouter>
      <UserContext.Provider>
        <div className="App">
          <Navigation />
          <Routes />
        </div>
      </UserContext.Provider>
    </BrowserRouter>
  );
}

export default App;
